DROP DATABASE opentable;
CREATE DATABASE opentable;

USE opentable;

CREATE TABLE restaurants (
  id int NOT NULL,
  name VARCHAR(50),
  description VARCHAR(500),
  rating FLOAT,
  reviews int,
  max_price int,
  food_type VARCHAR(20),
  tag1 VARCHAR(20),
  tag2 VARCHAR(20),
  tag3 VARCHAR(20)
);

